###DETAILS###'=>'Hei,

WordPressil on sisseehitatud mehhanism pluginate või teemade poolt tekitatud tõsiste vigade märkamiseks ja sellest automaatselt teavitamiseks.
###CAUSE###
Mine enda veebisaidile (###SITEURL###) ja otsi nähtavaid vigu. Seejärel mine lehele, kust see viga pärineb (###PAGEURL###), ja otsi ka sealt.

###SUPPORT###

Kui leht tundub olevat katki ja töölauale ei pääse ligi, siis nüüd on WordPressil eriline taastusrežiim. Selle abil saad turvaliselt logida enda töölauale sisse ja uurida edasi.

###LINK###

Turvalisuse tagamiseks aegub see viide mõne aja möödudes (###EXPIRES###). Selle pärast aga ei pea liialt muretsema - kui viga tekib peale aegumist uuesti, saadetakse viide uuesti.

